import{_ as e,c as i,o as l,d as a}from"./app.4fac507e.js";const m=JSON.parse('{"title":"Все про влагозащиту","description":"","frontmatter":{},"headers":[{"level":2,"title":"Зачем нужно покрывать электронику?","slug":"зачем-нужно-покрывать-электронику","link":"#зачем-нужно-покрывать-электронику","children":[]},{"level":2,"title":"Какие есть варианты влагозащиты для электроники?","slug":"какие-есть-варианты-влагозащиты-для-электроники","link":"#какие-есть-варианты-влагозащиты-для-электроники","children":[]},{"level":2,"title":"KOTKING, если недоступно тут, ищите на teamblacksheep или в барахолке","slug":"kotking-если-недоступно-тут-ищите-на-teamblacksheep-или-в-барахолке","link":"#kotking-если-недоступно-тут-ищите-на-teamblacksheep-или-в-барахолке","children":[{"level":3,"title":"Клей 705, купить можно здесь","slug":"клеи-705-купить-можно-здесь","link":"#клеи-705-купить-можно-здесь","children":[]},{"level":3,"title":"Клей B-7000, купить можно здесь","slug":"клеи-b-7000-купить-можно-здесь","link":"#клеи-b-7000-купить-можно-здесь","children":[]},{"level":3,"title":"Spinner protection silicone conformal coating V2 (спинер жижа v2) купить можно здесь","slug":"spinner-protection-silicone-conformal-coating-v2-спинер-жижа-v2-купить-можно-здесь","link":"#spinner-protection-silicone-conformal-coating-v2-спинер-жижа-v2-купить-можно-здесь","children":[]},{"level":3,"title":"DCA Electrolube, купить можно здесь","slug":"dca-electrolube-купить-можно-здесь","link":"#dca-electrolube-купить-можно-здесь","children":[]},{"level":3,"title":"Китайская защита для плат ip65, купить можно здесь","slug":"китаиская-защита-для-плат-ip65-купить-можно-здесь","link":"#китаиская-защита-для-плат-ip65-купить-можно-здесь","children":[]},{"level":3,"title":"Жидкая изолента","slug":"жидкая-изолента","link":"#жидкая-изолента","children":[]},{"level":3,"title":"Устаревшее:","slug":"устаревшее","link":"#устаревшее","children":[]},{"level":3,"title":"Пластик-71, купить можно здесь","slug":"пластик-71-купить-можно-здесь","link":"#пластик-71-купить-можно-здесь","children":[]},{"level":3,"title":"MG Chemicals 422B, снят с произодства","slug":"mg-chemicals-422b-снят-с-произодства","link":"#mg-chemicals-422b-снят-с-произодства","children":[]},{"level":3,"title":"MG Chemicals 422C, пропадает из вида","slug":"mg-chemicals-422c-пропадает-из-вида","link":"#mg-chemicals-422c-пропадает-из-вида","children":[]},{"level":3,"title":"FX_FPV AeroX, снят с производства","slug":"fx-fpv-aerox-снят-с-производства","link":"#fx-fpv-aerox-снят-с-производства","children":[]}]}],"relativePath":"community/coating.md"}'),r={name:"community/coating.md"},t=a('<h1 id="все-про-влагозащиту" tabindex="-1">Все про влагозащиту <a class="header-anchor" href="#все-про-влагозащиту" aria-hidden="true">#</a></h1><h2 id="зачем-нужно-покрывать-электронику" tabindex="-1">Зачем нужно покрывать электронику? <a class="header-anchor" href="#зачем-нужно-покрывать-электронику" aria-hidden="true">#</a></h2><p>Без влагозащиты летать в снег и дождь на дронах рисковая затея - при попадании влаги на работающую электронику возможны (и в большинстве случаев возникают) глюки в виде внезапного отказа двигателей, потери связи, а при падении в соленую воду (море) окислы и повреждение схемы.</p><h2 id="какие-есть-варианты-влагозащиты-для-электроники" tabindex="-1">Какие есть варианты влагозащиты для электроники? <a class="header-anchor" href="#какие-есть-варианты-влагозащиты-для-электроники" aria-hidden="true">#</a></h2><p>На 2023 год актуальны следующие варианты:</p><ul><li>kotking</li><li>силиконовый клей 705</li><li>клей B-7000</li><li>силиконовый лак Antas ZS-NJ-D955</li><li>силиконовый герметик FX_FPV AeroX V2</li><li>силиконовый лак FX_FPV Aero Light</li><li>DCA Electrolube</li><li>Spinner protection silicone conformal coating V2 (спинер жижа)</li><li>китайская силиконовая защита для плат ip65</li></ul><p>Немного о каждом из них:</p><h2 id="kotking-если-недоступно-тут-ищите-на-teamblacksheep-или-в-барахолке" tabindex="-1">KOTKING, <a href="https://www.fpvmatrix.ru/index.php?route=product/product&amp;product_id=339&amp;search=kotking" target="_blank" rel="noreferrer">если недоступно тут, ищите на teamblacksheep или в барахолке</a> <a class="header-anchor" href="#kotking-если-недоступно-тут-ищите-на-teamblacksheep-или-в-барахолке" aria-hidden="true">#</a></h2><p>Силикон. Коткинг всегда был товаром премиум класса, продавался в основном за рубежом, а цена всегда была выше, чем у аналогов. Представляет собой тюбик небольшого объема с жидким силиконом внутри. Объема хватает, чтобы покрыть не самым толстым слоем 3-4 коптера (подразумеваю электронику). По инструкции он должен схватываться за 15-20 минут, но на личном опыте попадались разные, иногда попадался очень жидкий, такой схватывался через 12-16 часов, застывал больше суток; иногда попадался погуще, и застывал согласно инструкции; при этом жидкий спокойно хранился 2 месяца в полке, и за это время не менял своих свойств. До засыхания присутствует неприятный запах. Покрытие достаточно надежное, подтверждением тому ролики, как коптеры с покрытой им электроникой отлично работают под водой. Однако практика показала, что спустя сутки - двое нахождения включенного дрона в водоеме часть электроники все равно погибает, гарантий 100%, увы, нет. Если не было ручного вмешательства, он остается целостным слоем и защищает платы на отлично. Невозможно паять через нанесенный слой. Снимать не особо удобно, нельзя подцепить с краю и стянуть весь слой с платы, отрывается кусочками. Ацетоном не смывается. Поговаривают, что можно снять с помощью растворителя 646 и щетки (если есть такой опыт, просьба дописать). Немаловажный неприятный момент: при длительном хранении (несколько месяцев) может застыть внутри тюбика. Итого:</p><ul><li><p>относительно надежно защищает от влаги</p></li><li><p>слой не повреждается без внешнего воздействия</p></li><li><p>бывает труднодоступен в РФ</p></li></ul><ul><li>дорогой (15мл за 12$, в РФ часто по ~1100р)</li><li>есть жалобы, что может застыть даже в запакованном виде при долгом хранении</li><li>тюбика хватает максимум на 3-4 коптера</li><li>имеет неприятный запах до засыхания</li><li>не каждое средство способно отмыть его с платы</li><li>нельзя паять через нанесенный слой, нужно снять (отковырять) кусочек с места пайки</li></ul><p align="center"><img src="https://kotking.com/wp-content/uploads/2021/12/new02-1536x864.jpg" width="600" alt="KOTKING"></p><h3 id="клеи-705-купить-можно-здесь" tabindex="-1">Клей 705, <a href="https://air-hobby.ru/katalog/product/3737-silikonoviy-kley-germetik-705-prozrachniy-50-ml.html" target="_blank" rel="noreferrer">купить можно здесь</a> <a class="header-anchor" href="#клеи-705-купить-можно-здесь" aria-hidden="true">#</a></h3><p>Силикон, хоть и клей по описанию, но неплохо справляется в качестве герметика. Также встречается в варианте k-705. Наносится из тюбика относительно густой каплей и размазывается палочкой по всей площади или выдавливается через доп насадку с узким отверстием, главное, не забывать его потом чистить или плотно заматывать, чтобы в следующий раз можно было воспользоваться. Схватывается за 20-30 минут, если нанесено не сильно толстым слоем. По свойствам схож с kotking. Практически не пахнет. Итого:</p><ul><li><p>дешевый (до 300р за тюбик 45г)</p></li><li><p>доступный</p></li><li><p>относительно надежно защищает от влаги</p></li><li><p>практически не пахнет</p></li><li><p>быстро застывает при умеренном слое</p></li><li><p>слой не повреждается без внешнего воздействия</p></li><li><p>не смывается ацетоном, возможно поможет отмачивание в бензине 10-15 минут</p></li><li><p>нельзя паять через него</p></li></ul><p align="center"><img src="https://aliradar.com/api/image?url=https%3A%2F%2Fae01.alicdn.com%2Fkf%2FHTB1y0szNhYaK1RjSZFnq6y80pXan%2F705-Silicone-Clear-Sealing-Glue-Waterproof-Heat-Resist-For-Electron-Component-Adhesives-Sealers.jpg_220x220.jpg_Q70.jpg_.webp" width="600" alt="705"></p><h3 id="клеи-b-7000-купить-можно-здесь" tabindex="-1">Клей B-7000, <a href="https://www.wildberries.ru/catalog/14059777/detail.aspx" target="_blank" rel="noreferrer">купить можно здесь</a> <a class="header-anchor" href="#клеи-b-7000-купить-можно-здесь" aria-hidden="true">#</a></h3><p>Клей B-7000, несмотря на то, что клей, также отлично справляется с задачей влагозащиты, устойчив к температурам, которые достигаются электроникой в простоях. Стоит дешево, есть варианты тюбиков разного объема, много где продается. Однако встречается много производителей этого клея (кто-то насчитывал не менее 15), и консистенция может немного отличаться. У хороших версий содержимое достаточно жидкое, легко наносится, нанесенный слой прозрачен, застывает без пузырьков с воздухом (само собой перед нанесением плату желательно очистить от пыли и прочего). Если вам попался очень вязкий/желтоватый, либо он очень долго хранился, либо из партии похуже. Схватывается за 15-30 минут, для полного засыхания рекомендуется подождать несколько часов. Можно паять через него, но занятие не из самых приятных, выделяется ужасный запах. Если вам попался хороший вариант этого клея, можно снять путем подцепки с краю и наматывания на пинцет. Если вам не повезло с производителем, сходит только после отмачивания в ацетоне на протяжении 10 минут или наматыванием после прогрева, но есть риск снять вместе с SMD элементами с платы. Итого:</p><ul><li><p>дешевый (до 200р за тюбик до 50мл)</p></li><li><p>доступный</p></li><li><p>удобно наносить</p></li><li><p>надежно защищает от влаги</p></li><li><p>быстро засыхает</p></li><li><p>иногда попадается &quot;брак&quot;</p></li><li><p>при попытке паять через него выделяется едкий запах</p></li><li><p>при снятии есть риск, что снимется с SMD компонентами платы</p></li></ul><p align="center"><img src="https://avatars.mds.yandex.net/get-mpic/5288781/img_id9048331639805302261.jpeg/orig" width="600" alt="B-7000"></p><h3 id="spinner-protection-silicone-conformal-coating-v2-спинер-жижа-v2-купить-можно-здесь" tabindex="-1">Spinner protection silicone conformal coating V2 (спинер жижа v2) <a href="https://www.spinnerproduction.ru/catalog-0-846" target="_blank" rel="noreferrer">купить можно здесь</a> <a class="header-anchor" href="#spinner-protection-silicone-conformal-coating-v2-спинер-жижа-v2-купить-можно-здесь" aria-hidden="true">#</a></h3><p>Лак. Многие предположат, что это DCA или 422C, но у него другой состав (со слов продавца). Личного не проверяла (у кого есть опыт, просьба дополнить статью). Стоит 600р за 20мл. По отзывам поведение схоже с 422C - долго сохнет и не идеально защищает от влаги.</p><p align="center"><img src="https://www.spinnerproduction.ru/crop_image/spinner/mainr846tekstil-tekstil-20210607_223838.jpg" width="600" alt="спинер жижа"></p><h3 id="dca-electrolube-купить-можно-здесь" tabindex="-1">DCA Electrolube, <a href="https://air-hobby.ru/katalog/product/2286-dca-electrolube-prozrachniy-lak-na-osnove-modifitsirovannogo-silikona-20ml.html" target="_blank" rel="noreferrer">купить можно здесь</a> <a class="header-anchor" href="#dca-electrolube-купить-можно-здесь" aria-hidden="true">#</a></h3><p>Лак. Продается как и 422C, жидкая, сохнет очень долго, положительных отзывов меньше, чем на вышеперечисленные аналоги.</p><p align="center"><img src="https://air-hobby.ru/components/com_virtuemart/shop_image/product/lectrolube_prozrachnyy_lak_na_osnove_modificirovannogo_silikona_25ml_59fb07f1eb67b.jpg" width="600" alt="DCA Electrolube"></p><h3 id="китаиская-защита-для-плат-ip65-купить-можно-здесь" tabindex="-1">Китайская защита для плат ip65, <a href="https://a.aliexpress.com/_mKX5LuM" target="_blank" rel="noreferrer">купить можно здесь</a> <a class="header-anchor" href="#китаиская-защита-для-плат-ip65-купить-можно-здесь" aria-hidden="true">#</a></h3><p>Лак. Напоминает 422B, но более вязкий. Также с едким запахом. Засыхает за 15 минут, для полного высыхания лучше подождать сутки, как и при использовании других лаков. 1 слоя достаточно. Можно паять через нанесенный слой, смывается щеткой с ацетоном. На личном опыте пока не подводила, не трескалась. Тюбик лучше не оставлять открытым, так как густеет. Объема хватит на очень долго, быстрее высохнет, чем закончится, если не разделить по тюбикам. Итого:</p><ul><li>дешевая (8$ за 100мл)</li><li>среди аналогов 422C, dca, спинер жижи в2 больше всех внушает доверие</li><li>легко смывается</li><li>быстро засыхает</li><li>хорошая адгезия</li><li>можно паять через нанесенный слой</li></ul><ul><li>не самый доступный вариант, купить можно только на алиэкспресс</li><li>имеет едкий запах</li></ul><p align="center"><img src="https://ae04.alicdn.com/kf/S96c49d979a85429bb51021eaedfa4832M/-.jpg" width="600" alt="ip65"></p><h3 id="жидкая-изолента" tabindex="-1">Жидкая изолента <a class="header-anchor" href="#жидкая-изолента" aria-hidden="true">#</a></h3><p>Предложен еще один вариант, не особо популярный - жидкая изолента. Обезжириваете спиртом электронику, сушите, наносите слой. Засыхает слой за 15-20 минут. Снимается одним слоем как изолента. Стоимость спрея 500мл до 900р. Позже будет добавлена ссылка.</p><h3 id="устаревшее" tabindex="-1">Устаревшее: <a class="header-anchor" href="#устаревшее" aria-hidden="true">#</a></h3><h3 id="пластик-71-купить-можно-здесь" tabindex="-1">Пластик-71, <a href="https://www.chipdip.ru/product/plastik-71-100" target="_blank" rel="noreferrer">купить можно здесь</a> <a class="header-anchor" href="#пластик-71-купить-можно-здесь" aria-hidden="true">#</a></h3><p>Лак. Пластик-71 изначально зарекомендовал себя как самый доступный, поскольку продается в каждом радиомагазине, но неудачный вариант, так как при эксплуатации очень быстро трескается и пропускает всю влагу. Можно наносить в несколько слоев, тогда больше вероятность, что он дольше продержится, но гарантий особо нет. Также есть мнение, что в зависимости от производителя состав отличается, были отзывы, что отлично справляется со своей задачей, но таких отзывов совсем мало. Итого:</p><ul><li>дешевый (до 200р за флакон до 100мл)</li><li>доступный (можно купить в любом радиомагазине)</li></ul><ul><li>не гарантирует влагозащиту, так как трескается со временем.</li></ul><p><strong>Хоббисты не рекомендуют к эксплуатации.</strong></p><p align="center"><img src="https://cdn1.ozone.ru/s3/multimedia-1/wc1200/6125209837.jpg" width="600" alt="пластик-71"></p><h3 id="mg-chemicals-422b-снят-с-произодства" tabindex="-1">MG Chemicals 422B, <a href="https://www.farnell.com/datasheets/2614568.pdf" target="_blank" rel="noreferrer">снят с произодства</a> <a class="header-anchor" href="#mg-chemicals-422b-снят-с-произодства" aria-hidden="true">#</a></h3><p>Лак. Долгое время был относительно доступным, продавался в ЧипДип в небольших флаконах, канистрами в розничных магазинах, тюбиками по 20-25мл в spinner production и воздушном хобби (ВХ) под видом спинер жижи, а под конец как &quot;ВХ 422B&quot;. Был неким компромиссом, стоил в районе 300-400р за 20мл, чего хватало на год активного использования, слой схватывался за минут 10, за 15 уже застывал, но рекомендовалось для полного высыхания ждать сутки в комнатной температуре. 1 слоя было достаточно, чтобы защитить от влаги, но когда температура понижалась(полеты зимой), она начинала трескаться и пропускала влагу. В 2021 году прекратилось производство, теперь нигде не купить. Альтернативой стала версия 422С.</p><h3 id="mg-chemicals-422c-пропадает-из-вида" tabindex="-1">MG Chemicals 422C, <a href="https://www.mgchemicals.com/products/conformal-coatings/silicone-conformal-coatings/conformal-coating-waterproof/" target="_blank" rel="noreferrer">пропадает из вида</a> <a class="header-anchor" href="#mg-chemicals-422c-пропадает-из-вида" aria-hidden="true">#</a></h3><p>Лак. Есть много разных отзывов, на деле лично не удалось попробовать (у кого есть опыт, просьба дополнить статью), предположительно по эксплуатации схоже с 422b, только более жидкий и сохнет дольше (по 30-40 минут застывает 1 слой). Некоторое время продавался как раньше 422b, только под другим названием, сейчас постепенно исчезает из тех же магазинов. Итого:</p><ul><li>из средней ценовой категории (700р за 20мл в ВХ был в 2022)</li><li>можно паять через нанесенный слой</li><li>легко снять щеткой со спиртом или ацетоном (и нет, ацетон не разъедает моментально пластик и надписи, разве что если вы на сутки в ацетоне замочите плату)</li></ul><ul><li>в РФ уже не так просто найти</li><li>долго сохнет</li><li>не гарантирует 100% влагозащиту</li></ul><h3 id="fx-fpv-aerox-снят-с-производства" tabindex="-1">FX_FPV AeroX, <a href="https://quadro.team/goods/aerox" target="_blank" rel="noreferrer">снят с производства</a> <a class="header-anchor" href="#fx-fpv-aerox-снят-с-производства" aria-hidden="true">#</a></h3><p>Силикон. Новинка 2022 года, состав схож с составом коткинга, поскольку по густоте, времени засыхания, получаемому покрытию, адгезии к электронике очень схожи. Схватывается за 15 минут(еще липкий, но уже не растекается), застывает за 30 минут. В отличие от коткинга не имеет запаха. Снимается так же, как коткинг-путем поддевания и отрывания кусочно, ацетоном не разъедается. Но есть хитрость-можно подержать в смеси галоша+изопропанол 15 мин, сойдет одним слоем. Невозможна пайка через нанесенный слой. Благодаря кисти легко наносить тонким слоем, расход меньше, чем у коткинга. Без внешнего воздействия сохраняет целостность. По времени хранения не превосходит коткинг, после вскрытия и нескольких использований спустя месяц загустел так сильно, что стал непригоден для эксплуатации, хотя закрывался плотно и не стоял открытым долго. Спиртом развести не получится, не взаимодействуют. Итого:</p><ul><li>доступен только в РФ</li><li>из средней ценовой категории (950р за 20мл)</li><li>надежно защищает от влаги</li><li>хорошая адгезия</li><li>отсутствует запах</li><li>для снятия нужно отмочить в смеси галоша + изопропанол 15 мин или снимать кусочно</li></ul><ul><li>после вскрытия долго не хранится</li><li>нельзя паять через нанесенный слой</li></ul><p align="center"><img src="https://i1.stat01.com/2/6877/168763447/075a3e/photo2022-03-3122-19-17-jpg.jpg" width="600" alt="AeroX"></p>',51),n=[t];function o(c,p,h,s,d,u){return l(),i("div",null,n)}const f=e(r,[["render",o]]);export{m as __pageData,f as default};
